           <li>Student Outreach Database (PSQL/PHP/HTML) - used for Westmont College ministry teams to monitor participation</li>
           <li>- an Android app that provides helpful information about hiking in Santa Barbara and includes interactive safety features</li>
         </ul>
      </div>
      <div>
        here are some classes
      </div>
      <div>
        I have experience
      </div>
    </div>
  );
}
export default ComputerScience
